column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
LaLaBEAUTY02　ララビューティー3D美顔ローラー<br>
<br>
3D美顔ローラー「LaLaBEAUTY Ring(ララビューティーリング)」<br>
Y字型で凸型特殊形状+リングのラインが狙った脂肪を逃がさない！<br>
マッサージのような効果で表皮を時にはつまみ、時には和やかに流し、揉みほぐしてくれます。<br>
心地の良い刺激が毛穴引き締め、美肌をサポート。<br>
少し大きめの美顔/ボディー兼用ローラーなのでお顔はもちろんの事、ウエスト、二の腕もガッチリ抑えます！<br>
マッサージローラーとして体全身で大活躍。<br>
<br>
【特徴】<br>
・マッサージ3D美顔/ボディーローラー<br>
・お肌やボディーの上を3分つまみながら転がすだけの簡単マッサージ。<br>
・独自のY字型構造設計でエステのようなマッサージ感<br>
・ダイヤカットのマッサージボールがタッピング効果で血行促進<br>
・持ちやすいエルゴノミクスデザインのハンドル<br>
・完全防水設計でバスタイムや化粧水をつけたお肌にも使える。<br>
・顔、二の腕、ウエスト、ヒップ、ふくらはぎ、足など様々な部位に使えます。<br>
・グリップ先端にはツボ押し用のワンポイント突起がデザイン。<br>
<br>
Y字型+リングのラインがフェイスやボディの狙った場所をガイドしてくれます。<br>
三角に突起した凸型特殊形状が複数のマッサージポイントを生み出し、表皮しっかり引き上げます。血行を促進、リフトアップに大活躍。<br>
大きすぎず、小さすぎないフォルムは<br>
お顔だけでなく気になるボディのお肉もグイグイつまみあげ、マッサージします。<br>
持ちやすいハンドルはエルゴノミクスデザイン。<br>
先端にはツボ押し用のワンポイント突起がデザインされ<br>
引き上げやマッサージが終了したら、そのままツボ押しマッサージで癒しの時間に。<br>
疲れにくく実用性のあるハンドルです。<br>
中型のハンディサイズなので、程よい大きさが実用性を実感。<br>
小回りが効き、目元や口元など、お顔の細かいパーツにももちろん有効です。<br>
お風呂場に持ち込んでも安心の完全防水設計。化粧水をつけたお顔や、バスタブの中での使用もOKで、<br>
リラックスタイムをさらに効果的に♪<br>
一日3分転がすだけの簡単エステ！<br>
<br>
安心設計＆安心価格＆安心保障（1年保証）<br>
３つの安心を約束！<br>
<br>
規格<br>
サイズ：約H150×W64×D45cm<br>
重さ：約143g <br>
素材：ABS/亜鉛合金/クロムメッキ<br>
セット内容：本体×1,ポーチ×1,取扱説明書・保証書(日本語)×1<br>
<br>
※ご使用は1日につき3回、同じ箇所には３分までとしてください。 <br>
※やさしく適度な力でご使用ください。力を入れすぎるとお肌を傷つけるおそれがあります。<br>
※衣服の上から使用すると、衣服を損傷するおそれがあります。 <br>
※ご使用後にお肌が赤くなることがありますが、これはマッサージによるものなの で正常です。<br>
　しばらくたっても消えない場合(個人差があります)、翌日になって も消えない場合は使用を中止し、医師にご相談<br>
　ください。 <br>
※金属アレルギーの方のご使用はおやめください。<br>
<br>
